import logonavbar from "../../imagens/logo-navbar.png";
import './Navbar.scss';
import { Link } from 'react-router-dom';


function navbar() {
  return (
    <>

          <noscript>You need to enable JavaScript to run this app.</noscript>
          <div id="root"></div>
          <div  style={{  padding:'0', margin:'22px 0 0 0' }}></div>

          <nav className="navbar navbar-expand-sm" style={{ height: '65px', margin:'22px 0 0 0', backgroundColor:'white' }}>

            <div className="container-fluid">

              {/*logo*/}
              <a class="navbar-brand" href="#">
              <img src= {logonavbar} alt="Logo" style={{ height: '45px' }}/>
              </a>
              {/*logo*/}

                <div id="links_navbar" style={{ padding: '0 15px 0 15px' }}>
                <Link className="navbar-brand text-primary" to='/' style={{ fontWeight: 'bold', padding: '0 15px 0 15px'}}>Home</Link>

                <Link className="navbar-brand text-primary " to='/Etes' style={{ fontWeight: 'bold' , padding: '0 15px 0 15px'}}>ETE´S</Link>

                <Link className="navbar-brand text-primary " to='/Sobre' style={{ fontWeight: 'bold' , padding: '0 15px 0 15px'}} >Diretório</Link>

                <Link className="navbar-brand text-primary " to='/Sobre' style={{ fontWeight: 'bold', padding: '0 15px 0 15px' }} >Entre em contato</Link>
                </div>


                <div id="icone-login" style={{textAlign:'center', color:'#0a3dbf'}}>
                <i className="bi bi-person-circle" style={{ fontSize: '30px' }}></i>
                <a className="nav-link" id="link-login"  href="#"> Login</a>
                </div>

            </div>

          </nav>

    </>
  )
}

export default navbar;
